// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract Library {
    address public owner;

    struct Book {
        string name;
        uint quantity;
        bool exists;
    }

    mapping(string => Book) BookList;

    modifier onlyOwnable(){
        require(msg.sender == owner, "Current user is not owner!");
        _;
    }


    //dictionary for existance of book

    //dictionary of borrowers of a given book (all borowers ever)

    constructor(){
        owner = msg.sender;
    }

    function AddBook(Book calldata newBook) public onlyOwnable{
        if(BookList[newBook.name].exists){
            revert("Book already exists in the Library!");
        }

    }

    function BorrowBook() public {
        //borrow book by id
    }

    function ReturnBook() public {

    }
}

